import { useParams } from "react-router-dom";
import Header from "../components/Header";
import { annonces } from "./Home";

function AnnoncePage() {
  const url = useParams();
  return (
    <>
      <Header />
      <main>
        <article>
          <p>L'url est : {annonces + url}</p>
        </article>
      </main>
    </>
  );
}
export default AnnoncePage;
